import iconPlay from "../../../Image/tutorial/icon-play.svg";

import iconJs from "../../../Image/tutorial/icon-javascript.svg";
import iconOobc from "../../../Image/tutorial/icon-oobc.svg";
import iconPython from "../../../Image/tutorial/icon-python.svg";

import badgeJs from "../../../Image/tutorial/badge-javascript.svg";
import badgeOobc from "../../../Image/tutorial/badge-oobc.svg";
import badgePython from "../../../Image/tutorial/badge-python.svg";

const IMAGE = {
  ICON_PLAY: iconPlay, 

  ICON_JS: iconJs,
  ICON_OOBC: iconOobc,
  ICON_PYTHON: iconPython,

  BADGE_JS: badgeJs,
  BADGE_OOBC: badgeOobc,
  BADGE_PYTHON: badgePython,
} 

export default IMAGE;
